import React from "react";
import ReactDOM from "react-dom/client";

import "./index.css";

const title = "The Woman in Me";
const author = "Britney Spears";
const img =
  "https://images-na.ssl-images-amazon.com/images/I/61KI7oL-u9L._AC_UL900_SR900,600_.jpg";

const BookList = () => {
  return (
    <section className="booklist">
      <Book></Book>
      <Book></Book>
      <Book></Book>
      <Book></Book>
    </section>
  );
};

const Book = () => {
  return (
    <article className="book">
      <img src={img} alt="The Woman in Me" />
      <h2>{title}</h2>
      <h4>{author}</h4>
    </article>
  );
};

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(<BookList></BookList>);
